import React, { useState, useEffect } from 'react';

export default function Dashboard() {
  const [payments, setPayments] = useState([]);

  useEffect(() => {
    // Fetch payment data from your API or database
    fetch('/api/http://localhost:8002/api/paymentDetails')
     .then(response => response.json())
     .then(data => setPayments(data));
  }, []);

  return (
    <div>
      <h1>Admin Panel</h1>
      <h2>Payments</h2>
      <ul>
        {payments.map((payment, index) => (
          <li key={index}>
            <span>Customer: {payment.customer_id}</span>
            <span>Payment Method: {payment.payment_method}</span>
            <span>Amount: {payment.amount}</span>
            <span>Products: {payment.products.join(', ')}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}
